import { createBrowserRouter, RouterProvider } from "react-router-dom";
import AllQuotes from "./components/quotes-test/AllQuotes.jsx";
import NewQuote from "./components/quotes-test/AllQuotes.jsx";
import QuoteDetail from "./components/quotes-test/AllQuotes.jsx";

const router = createBrowserRouter([
  {
    path: "/",
    element: <AllQuotes />,
    // children: [
    //   { path: "/:quoteId", element: <QuoteDetail /> },
    //   { path: "/new-quote", element: <NewQuote /> },
    // ],
  },
  { path: "/quote", element: <NewQuote /> },
]);
function App() {
  return <RouterProvider router={router} />;
}

export default App;
